import axios from '../../../untils/axios'
// import { useHistory } from 'react-router-dom'

const Pay = (props) => {
  // const history = useHistory()
  useEffect(() => {
    axios.post('/pay/getCode', { code: props.match.params.user }).then(() => {
      const a = props.match.params.user
      alert(a)
    })
    // history.goBack()
  }, [])
  return (
    <></>
  )
}

export default Pay
